  input: '"TEXT","F3XA","C00165688","ASDC Partnership Program is a joint fundraising
    programs in which the North Carolina Democratic Party participates.   Transfers
    are made to the NCDP on an as-needed basis.  Please note that state party committees
    have been reporting Memo Entries on Schedule A for contributions received by the
    joint fundraising program during the reporting period in which the contribution
    was received irrespective of whether transfers have been made.  Memo Entries on
    Schedule A from these programs reflect the gross amounts raised while the transfers
    to the NCDP reflect the net amount distributed to date.  Accordingly, there will
    always be a difference between the transfer and the Memo Schedule A totals.  By
    prior agreement between the NCDPs counsel and the FEC, Memo Schedule As for these
    programs are reported on a quarterly basis.    The receipt of funds from the State
    of North Carolina disclosed on Schedule A supporting Line 17 reflects the receipt
    of tax check-off funds.    The NCDP has used its best efforts as defined by the
    FEC to disclose the full identity of all individuals who contribute in excess
    of $200 in a calendar year.  In addition to requesting the information on the
    original solicitation, every 30 days the NCDP sends to all donors whose information
    is not complete a letter requesting the required information and includes a self-addressed
    stamped reply postcard.    All Payroll, Payroll Taxes, AFLCA Payroll,  Health
    Insurance, Payroll Pd to Seligman, and Supplemental Insurance disclosed on Schedule
    H4 are for employees who did NOT spend more than 25% of their compensated time
    in a given month on Federal Election Activity (FEA) or activities in connection
    with a Federal election.    No disbursement disclosed on Schedule B Supporting
    Line 21 or Schedule H4 of this report referred to a clearly identified federal
    candidate or was made on behalf of a clearly identified federal candidate.    Payment(s)
    disclosed for Generic Advertising were for non-public communication, generic activity.    No
    memo entries are itemized on Schedule B for the travel re-imbursement to Derwin
    Dubose (157.02), the office supply re-imbursement to Mark Hufford ($20.40), the
    GOTV Canvassing Work for J Ruth, Inc ($360.00) and PeopleTree Solutions ($252.00),
    and the catering reimbursement to Julia Lee ($90.72) because none of the payments
    to the original vendor exceeded the $200 aggregate threshold required for itemization.    The
    disbursements to Derwin Dubose in the amount of $725.65 and $157.02 are reported
    on Schedule B because they represent travel reimbursement for expenses associated
    with the Partys observation of recount procedures in connection with the 8th congressional
    district.    No disbursements for Catering were on behalf of a specifically identified
    federal candidate.    No disbursement disclosed on Schedule B for Line 30(b) for
    GOTV Radio, Mail House Expense, Newspaper Ads, or Postage referred to a clearly
    identified candidate for federal office.    The Committee diligently and timely
    filed 24-hour notices relating to Schedule F payments for disbursements made through
    Election Day.  Payments made after Election Day reflect expenditures that were
    incurred on Election Day itself for which we did not know the final amount owed
    until after Election Day or were for expenses incurred after Election Day which
    it is our understanding are not applicable to the Millionaires Amendment reporting
    requirements."'
